import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";

class Login extends Component {
  componentWillMount() {
    this.props.fetchUser();
  }
  render() {
    return <div />;
  }
}
Login.propTypes = {};

export default connect({})(Login);
